module.exports = "<div class=a>\n  <br>\n  <br>\n\n  <br>\n  <br>\n<br>\n\n<h2>\nOur Team           \n</h2>\n\n<div class=\"portfolio-category-content\">\n\n      <div class=\"project_container\">\n      \n        <div class=\"card hoverable\">\n      \n          <div class=\"card-start\">\n      \n             <h5>Rick Shrotri</h5>\n             <h6>Founder & Managing Partner</h6>\n               <ul>\n\n               <li>Mr. Shrotri has been a technology and telecommunications investor for over two decades, managing industry shaping investments.</li>\n\n               <li> Prior to founding Digital Alpha, Mr. Shrotri was Managing Director of Cisco's Business Acceleration Team, where he focused on identifying and developing opportunities from Cisco’s sales pipeline that require equity financing.</li>\n                \n             <li>  During his 10 years at Cisco Mr. Shrotri has worked on the growth strategy and investments, strategic partnerships, and managed a forum of executive reviews that include the firm’s most senior leadership.</li>\n                \n               <li>Prior to Cisco, Mr. Shrotri worked in the Seoul, Korea headquarters of Samsung, where he focused on external innovation strategy including M&A and JV structures for the semiconductor and mobility divisions.</li>\n                \n               <li>Mr. Shrotri also worked at Goldman Sachs focusing on tech/telecom investments in the Principal Investment Area (PIA).</li>\n                \n               <li> Mr. Shrotri holds degrees from the Wharton School at the University of Pennsylvania in Finance and International Relations, both summa cum laude, and an MBA from Harvard Business School, where he was a Baker Scholar.</li>\n          </ul>\n            \n          </div>\n      \n \n      \n          <br>\n      \n      </div>\n      \n\n<br>\n          \n          \n            <div class=\"card hoverable\">\n          \n                  <h5>Vasa Babic</h5>\n             <h6>Partner</h6>\n                <ul>\n                 <li> Mr. Babic has partnered with Mr. Shrotri for 5+ years in developing the Digital Alpha concept.</li>\n\n                <li> Mr. Babic has 25+ years global experience in the technology, telecoms and media sectors. He has a blend of expertise in Corporate Finance, Principal Investing, Corporate General Management and Strategic consultancy. His private practice has represented and advised several Global 500 companies on new investments, joint ventures and restructurings since 2009, as well as more performing more traditional strategic and operational consultancy work.</li>\n                  \n                 <li> Prior to independent advisory work, Vasa was a Partner and COO of Hanover Investors, a public market control-based equity Fund. He has served as a Non-Executive Director of FTSE and AIM listed companies in the UK, including a full 7 year term at Scottish Television Group PLC, where he also chaired the Remuneration committee.</li>\n                  \n              <li>   Vasa was previously the youngest Group Director at Vodafone, with a role leading post-merger integration, and the youngest partner worldwide in Oliver Wyman, a Strategy Consultancy, where he specialised in technology, telecoms and media. He has a degree in Economics from King’s College, Cambridge.</li>\n                 \n              \n                </ul>\n          \n     \n          \n              <br>\n          \n          </div>\n\n          <div class=\"card hoverable\">\n          \n            <h5>Dave Ward</h5>\n       <h6>Operating Partner</h6>\n          <ul>\n           <li>Mr.Ward is an industry pioneer, having most recently served as CTO and Chief Architect of Cisco's ~$50 Billion networking business.</li>\n\n          <li>He is one of two individuals to be both Cisco and Juniper Fellows, during a distinguished career where he has overseen the development of innovations covering networking orchestration & automation, virtualized & cloud-native services, cloud networking & security.</li>\n            \n           <li>Mr. Ward has unique expertise in 5G and IoT technologies that are important to Digital Alpha's investment strategy.</li>\n           \n\n           <li>Mr. Ward currently serves as CEO of Packet Fabric.</li>\n\n </ul>\n\n\n\n <br>\n \n </div>\n <div class=\"card hoverable\">\n          \n  <h5>Jeff Frazier</h5>\n<h6>Operating Partner</h6>\n<ul>\n <li> Mr. Frazier began his career as a Special Agent for the FBI, managing the agency's congressionally funded portfolio.</li>\n\n<li> He has senior executive experience at both Microsoft, where he ran the Public Sector business, and Cisco, where he managed Government Affairs reporting into the Chairman's Office of Cisco.</li>\n  \n <li> Mr. Frazier advises Digital Alpha on public sector opportunities, including Smart Cities, which are a key focus area for the Digital Alpha Funds.</li>\n  \n<li>   He currently serves in an advisory function to Quantela and COO of Pyron, Inc.</li>\n \n\n</ul>\n\n\n\n<br>\n\n</div>\n    \n\n <div class=\"card hoverable\">\n \n   <h5>Ed Olsen</h5>\n<h6>Operating Partner</h6>\n <ul>\n  <li> Mr. Olsen has decades of experience in digital advertising, having run the largest digital advertising agency in Silicon Valley prior to joining Cisco Systems, Inc. At Cisco Mr. Olsen was responsible for Content and Monetization Services tied to Sports and Entertainment, City Projects, and other digital infrastructure venues. He has led projects and teams worldwide that have received over 200 awards in recognition of their accomplishments as innovators. Mr. Olsen's 18 years of Digital ROI and Sales Generation activities are important to Digital Alpha's Revenue Sharing portfolio of opportunities.</li>\n\n <li> Mr. Olsen currently drives monetization activities in North America for Quantela and assists selected DA portfolio companies on monetization plans worldwide.</li>\n   \n    \n\n </ul>\n\n\n\n<br>\n\n</div>\n\n\n\n              \n              \n<div class=\"card hoverable\">\n                    \n\n  <h5>Neil Sheridan</h5>\n<h6>Principal</h6>\n\n  <ul>\n\n    <li>Mr. Sheridan has a decade of investment experience at leading private equity and investment banking firms.</li>\n    <li>Prior to joining Digital Alpha, Mr. Sheridan was a Vice President at San Francisco-based private equity firm Golden Gate Capital, where he focused on technology investments across the software, information services, and technology-enabled services ecosystems.</li>\n    <li>Previously, Mr. Sheridan was an Investment Banking Analyst at Greenhill & Company’s New York office, where he focused on M&A and restructuring transactions.</li>\n    <li>Mr. Sheridan is a graduate with honors from New York University’s Stern School of Business, where he majored in finance and economics and studied abroad in London and Hong Kong. He is a CFA Charterholder.</li>\n\n\n\n\n\n\n     </ul>\n\n\n\n\n\n\n\n<br>\n\n\n</div>\n\n\n\n\n\n\n\n\n\n\n\n\n\n<div class=\"card hoverable\">\n                    \n\n  <h5>Andy Alcon, CPA</h5>\n<h6>Chief Financial Officer</h6>\n\n  <ul>\n  <li>  Mr. Alcon has been CFO for Digital Alpha since inception.</li>\n  <li>  He has 33+ years experience overseeing accounting, reporting, treasury and investor relations.</li>\n   <li>Previously, Andy was CFO for Crosspoint Venture Partners, a prominent Silicon Valley firm.</li>\n    <li>He has experience in SEC requirements associated with the investment industry.</li>\n    <li>Mr. Alcon began his career at Peat, Marwick & Mitchell & Co.</li>\n   <li>Crosspoint raised over $1.8 billion large institutions and strategics across 11 funds, distributing $9.4+ billion during his tenure.</li>\n     </ul>\n\n\n\n\n\n\n\n<br>\n\n\n</div>\n\n\n\n              \n              \n<div class=\"card hoverable\">\n                \n  <h5>Suzanne DeTore</h5>\n<h6>Senior Associate</h6>\n\n  <ul>\n     <li>Ms. DeTore has spent the past six years at leading private equity and investment banking firms.</li>\n     <li>Prior to joining Digital Alpha, Ms. DeTore was a Senior Associate at San Francisco-based private equity firm FFL Partners.</li>\n     <li>Previously, Ms. DeTore was an Associate at San-Francisco based private equity firm Genstar, where she focused on software investments.</li>\n     <li>Prior to entering private equity, she was an Investment Banking Analyst at J.P.Morgan’s New York office, where she focused on M&A and financing transactions in the technology, media and telecommunications space.</li>\n     <li>Ms. DeTore is a graduate from the Massachusetts Institute of Technology (MIT), where she majored in Management with a concentration in Finance.</li>\n\n\n\n   \n     </ul>\n\n\n\n\n\n<br>\n\n</div>\n\n\n\n<div class=\"card hoverable\">\n                \n  <h5>Carol Lim</h5>\n<h6>Associate</h6>\n\n  <ul>\n     <li>Ms. Lim has experience in complex buy-side transactions and strategic evaluation.</li>\n     <li>Prior to joining Digital Alpha, she was an Associate at Liberty Media, a media and communications conglomerate, where she evaluated investment opportunities across the Liberty family and served as a portfolio company board observer.</li>\n     <li>She began her career as an Investment Banking Analyst in the Mergers and Acquisitions group at Bank of America Merrill Lynch.</li>\n     <li>Ms. Lim graduated summa cum laude with a degree in economics from the University of California, Los Angeles.</li>\n\n\n\n   \n     </ul>\n\n\n\n\n\n<br>\n\n</div>\n\n\n\n              \n              \n\n              \n              \n                  <div class=\"card hoverable\">\n                \n                        <h5>Anais Benhassaine</h5>\n             <h6>Associate,   Legal Counsel</h6>\n                \n                        <ul>\n                           <li> Ms. Benhassaine is a licensed attorney in the UK, France and the US (awaiting admission to the NY Bar) and has structured, negotiated, and executed legal agreements with leading Silicon Valley enterprises for global deployments with Digital Alpha.</li>\n\n         \n                            <li>She holds a LL.M in Corporate, Banking and Finance at Fordham Law School.</li>\n\n                             \n                              <li>Ms. Benhassaine has a MSc in Tax Law and Finance from Edhec Business School, Paris.</li>\n\n                             \n                              <li>She has received a Master of Corporate Law, and a Bachelor of Law Degree from Jean Moulin University, Lyon, France. </li>\n\n\n\n                         \n                           </ul>\n                    \n                      \n                \n           \n                \n                    <br>\n                \n                </div>\n              \n              \n                  <div class=\"card hoverable\">\n                \n                        <h5>David O’Neil</h5>\n           <h6>Associate</h6>\n                \n                        <ul>\n                         <li>Mr. O’Neil has experience in high technology and communications transactions, with a focus on IPOs, Mergers and Acquisitions, and complex financings.</li>                          \n\n\n                         <li>Most recently he was a Senior Investment Banking Analyst in the Global Technology Group of Citigroup, based in San Francisco.</li>\n                          <li>Prior to Citigroup, David spent 2 years at Goldman Sachs as an Investment Banking Analyst.</li>\n                          <li>Mr. O’Neil graduated with Highest Honors from the University of Texas, Austin with Masters in Professional Accounting and Bachelors in Business Administration Degrees.</li> \n                        </ul>\n                    \n                      \n                    <br>\n                \n                  </div>\n              \n              \n                    <div class=\"card hoverable\">\n                  \n                        \n                          <h5>Natalie Topham-Smith</h5>\n             <h6>Investor Relations</h6>\n             \n                  \n                          <ul>\n                          <li> Ms. Topham-Smith has joined Digital Alpha after a two decade career at top investment firms, including Soros Group, Kohlberg, Kravis and Roberts (KKR), and Blackstone Group.   </li>\n\n           \n                          <li>  Ms. Topham-Smith started her career at Morgan Stanley in London.</li>\n                               \n                             <li> Ms. Topham-Smith studied at the London School of Economics, focused on Economic Principles and International Economics.</li>\n\n                               \n                              \n                           \n                             </ul>\n                      \n                        \n                  \n             \n                  \n                      <br>\n                  \n                  </div>\n                  \n              \n              \n                      <div class=\"card hoverable\">\n                    \n\n                            <h5>Jack McWhinnie</h5>\n               <h6>Analyst</h6>\n                    \n                            <ul>\n          \n                             <li> Mr. McWhinnie is an analyst supporting Investor Relations and deal activities for the fund. </li>\n                              <li> Prior to joining Digital Alpha, Mr. McWhinnie interned at Hanover Investors, a private equity firm.</li>\n                              <li> Mr McWhinnie has prior internship experience at Morgan Stanley and the Royal Bank of Canada.</li>\n                             <li> He recieved a Bachelor of Science with honors at the University of Warwick, where he focused on Finance.</li>\n                               </ul>\n                        \n                          \n                  \n\n\n\n                  <br>\n                  \n                  </div>\n                  \n                    \n\n                    \n\n<style>\nli {\nfont-size: 12px;\ntext-align: left;\n}\nh2 {\ntext-align: center;\ncolor:beige;\n}\nh5, h6 {\ntext-align: left;\nfont-size: 15px;\n}\n.a {\nbackground-color: #3B4D8C; \n}\n</style>\n"

