module.exports = "\n  <div class=\"a\">\n\n    <br>\n  \n    <br>\n  \n    <br>\n  \n    <br>\n  \n    <br>\n  \n    <br>\n  \n    <br>\n  \n    <br>\n    <h2>Enviromental, Social, Governance</h2>\n    <br>\n    <br>\n  \n    <div class=\"b\">\n  <h3>Purpose</h3>\n  \n    <br>\n    <br>\n     <h5> At Digital Alpha (“DA”) we believe that our fiduciary responsibility requires careful consideration of the impact our investments can have on environmental, social and governance (“ESG”) matters. DA believes a tailored approach to ESG issues for each of our portfolio companies will create value for not only our LPs, but for many other stakeholders. </h5>\n       <br>\n      <p>DA appreciates that tracking, collecting and reporting on ESG requires significant resources, however, we see that the incorporation of ESG is way of creating longer term sustainable growth for our portfolio companies. DA’s investments are predominantly ‘green’; developing technology and jobs related to the mission critical infrastructure needed in today’s modern world.</p>\n      <br>\n\n      <h3>Portfolio Examples</h3>\n    <br>\n      <p>UKCloud, a sovereign data cloud portfolio company, is now providing the first carbon negative cloud services in the UK.</p>\n      \n    \n      <p>Quantela has developed a contact tracing solution for covid-19 management for municipalities. </p>\n      \n      \n     <p> PacketFabric is providing essential connectivity services across the United States as business, governments and schools move critical functions online during the pandemic. </p>\n      \n      <br>\n      \n      <br>\n    </div>\n\n\n    <div class=\"portfolio-category-content\">\n\n\n      <div class=\"project_container\">\n      \n      \n        <div class=\"\">\n      \n          <div class=\"card-start\">\n      \n             \n            <div class=\"project_img\">\n              <img src=\"assets/images/ESG Dashboard Legal.jpg\" >\n            </div>\n            \n          </div>\n      \n \n      \n          <br>\n      \n      </div>\n      \n\n</div>\n\n\n\n<br>\n  \n      <h3 >Our ESG Strategy</h3>\n      <br>\n      <br>\n      <h4>Transparency and Governance</h4>\n       <br>\n      DA has developed a Responsible Investment Policy (RIP) which we believe incorporates industry leading practices in both the reporting and governance of our portfolio companies. DA aims to utilise independent standards-setting organization such as the “Sustainability Accounting Standards Board” and “Institutional Limited Partners Association Principals 3.0” to integrate industry specific frameworks and policies which best achieve our ESG goals.\n      <br>\n      <br>\n      <br>\n      <h4>Holistic ESG</h4>\n      \n      <br>\n  \n      DA integrates ESG considerations from the start of a portfolio company’s due diligence all the way through to its exit. We identify and monitor the most relevant ESG issues that directly reflect our portfolio companies’ unique operations. This integrated approach, in our opinion, drives the greatest ESG impact.\n      <br>\n      <br>\n      <br>\n      <h4>The Future of ESG Practices</h4>\n      \n      <br>\n      DA will continually strive to achieve the best ESG reporting practices and regularly participates in responsible investment conferences. DA is keen to play a leading role in ESG and Impact investing as drivers of relevance in the deals of the future.\n      <br>\n      <br>\n      <br>\n  <p><a href=\"https://ukcloud.com/governance/green-credentials/\">\n       1. UKCloud company website, June 2020\n       </a>\n       </p>\n  \n        <p> <a href=\"//blog.quantela.com/cover-components-and-features/\">\n          \n      2. Quantela company website June 2020\n      </a>\n      </p>\n  \n    \n      <p> <a href=\"//packetfabric.com/locations/\">\n          \n        3. PacketFabric company website June 2020\n        </a>\n        </p>\n\n  \n  <style>\n.project_img {\n\n  padding-left: 265px;\n  \n}\n\n\n  </style>\n   \n\n      \n      \n  \n      \n  \n     \n  \n  \n  \n  \n  \n  \n  \n  \n  \n  \n  \n  \n  \n  \n  \n  \n  \n    <br>\n  \n    <br>\n  \n    <br>\n  \n    <br>\n  \n    \n  \n  </div>\n  <style>\n  h2{\n    text-align: center;\n  }\n  .a {\n    background-color: #3B4D8C; \n\n    padding-left: 75px;\n    padding-right: 75px;\n  }\n  p {\n  color: beige;\n  }\n  </style>\n\n  \n\n\n"

